import ItemHeaderComponent from '../components/Item/ItemHeaderComponent';
import '../styles/item.css';
const Item = () => {
  return (
    <div className="content-body-item">
      <ItemHeaderComponent />

      <ItemComponent />
    </div>
  );
};
export default Item;
